import React, { useState, useEffect } from "react";
import { getMyClaims, getMyCustomerStatus, getAuth } from "../utils/api";
import "./CustomerStatus.css";

export default function CustomerStatus() {
  const [claims, setClaims] = useState([]);
  const [status, setStatus] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const fetchData = async () => {
    setLoading(true);
    setError("");

    const auth = getAuth();
    if (!auth || !auth.customerId) {
      setError("You are not logged in as a customer.");
      setLoading(false);
      return;
    }

    try {
      const [customerStatus, customerClaims] = await Promise.all([
        getMyCustomerStatus(),
        getMyClaims(),
      ]);

      setStatus(customerStatus);
      setClaims(customerClaims);
    } catch (err) {
      console.error(err);
      setError("Failed to fetch your status or claims.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  if (loading) return <div className="loading">Loading your status...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="customer-status-container">
      <h2>My Claim Status</h2>

      {status && (
        <table className="status-table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Total Claims</th>
              <th>Approved</th>
              <th>Rejected</th>
              <th>Pending</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{status.name}</td>
              <td>{status.totalClaims}</td>
              <td>{status.approvedClaims}</td>
              <td>{status.rejectedClaims}</td>
              <td>{status.pendingClaims}</td>
            </tr>
          </tbody>
        </table>
      )}

      <h3>My Claims</h3>
      <table className="claims-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Type</th>
            <th>Amount</th>
            <th>Status</th>
            <th>Submitted</th>
            <th>File</th>
          </tr>
        </thead>
        <tbody>
          {claims.length === 0 ? (
            <tr>
              <td colSpan="6" style={{ textAlign: "center" }}>
                No claims found.
              </td>
            </tr>
          ) : (
            claims.map((c) => (
              <tr key={c.id}>
                <td>{c.id}</td>
                <td>{c.claimType}</td>
                <td>{c.claimAmount?.toFixed(2)}</td>
                <td>{c.status}</td>
                <td>{new Date(c.submissionDate).toLocaleString()}</td>
                <td>
                  {c.fileUrl ? (
                    <a href={c.fileUrl} target="_blank" rel="noopener noreferrer">
                      View File
                    </a>
                  ) : (
                    <span className="text-muted">No file</span>
                  )}
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}
